import { ACTION_TYPES } from '../action/countryStats.action';


const initialState = {
    geoData: [],
    countryData: []
}

export const CountryStats = (state = initialState, action) => {

    switch (action.type) {

        case ACTION_TYPES.FETCHDVDATA:
            return{
                ...state,
                geoData: action.payload
            }
        default:
            return state
    }
}
